
// Logo BADEMA en base64
// generarOrdenCompraPDF.js
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
pdfMake.vfs = pdfFonts.vfs;

// Logo BADEMA en base64
const logoBase64 = "data:image/png;base64,"; // <- Pega tu base64 completo aquí

export function generarOrdenCompraPDF(orden) {

  const docDefinition = {
    content: [
      {
        columns: [
          {
            width: '50%',
            stack: [
              { image: logoBase64, width: 80, alignment: 'left' },
              { text: 'Constructora BADEMA Ltda.', style: 'headerSmall' },
              { text: `RUT: ${orden.empresaRut}`, style: 'small' },
              { text: `Dirección: ${orden.empresaDireccion}`, style: 'small' },
              { text: `Comuna: ${orden.empresaComuna}`, style: 'small' },
              { text: `Obra: ${orden.obra}`, style: 'small' }
            ]
          },
          {
            width: '50%',
            stack: []
          }
        ]
      },
      { text: `Orden de Compra Nº ${orden.numero}`, style: 'subheader', alignment: 'center' },

      {
        columns: [
          {
            width: '50%',
            stack: [
              { text: `Señores: ${orden.proveedorNombre}` },
              { text: `RUT: ${orden.proveedorRut}` },
              { text: `Dirección: ${orden.proveedorDireccion}` },
              { text: `Atención: ${orden.proveedorAtencion}` },
              { text: `Teléfono: ${orden.proveedorTelefono}` },
              { text: `Email: ${orden.proveedorEmail}` }
            ],
            style: 'small'
          },
          {
            width: '50%',
            alignment: 'right',
            stack: [
              { text: `FECHA: ${orden.fecha}` },
            ],
            style: 'small'
          }
        ]
      },

      { text: '\n' },

      {
        layout: {
          hLineWidth: function (i, node) {
            return i === node.table.body.length - 1 ? 0.8 : 0.8;
          },
          vLineWidth: function (i, node) {
            return i === 0 || i === node.table.widths.length - 1 ? 0.8 : 0.8;
          },
          hLineColor: () => 'black',
          vLineColor: () => 'black'
        },
        table: {
          widths: ['auto', 'auto', '*', 'auto', 'auto', 'auto', 'auto', 'auto'],
          body: [
            [
              { text: 'Item', bold: true },
              { text: 'Código', bold: true },
              { text: 'Descripción', bold: true },
              { text: 'Unidad', bold: true },
              { text: 'Cantidad', bold: true },
              { text: 'P. Unitario', bold: true },
              { text: 'Descuento', bold: true },
              { text: 'Valor', bold: true }
            ],
            ...orden.items.map((item, i) => [
              i + 1,
              item.codigo,
              item.descripcion,
              item.unidad,
              item.cantidad,
              `$${item.precioUnitario.toLocaleString()}`,
              `${item.descuento}%`,
              `$${item.valor.toLocaleString()}`
            ]),
            [
              { text: '', colSpan: 5, border: [false, false, false, false] }, {}, {}, {}, {},
              {
                stack: [
                  { text: 'Total Neto:', alignment: 'left', bold: true },
                  { text: 'Descuento:', alignment: 'left', bold: true },
                  { text: 'Total Neto:', alignment: 'left', bold: true },
                  { text: 'I.V.A.:', alignment: 'left', bold: true },
                  { text: 'Total:', alignment: 'left', bold: true }
                ],
                border: [true, true, false, true]
              },
              {
                stack: [
                  { text: `${orden.totalDescuento}%`, alignment: 'center' },
                  { text: `${orden.totalDescuento}%`, alignment: 'center' },
                  { text: `${orden.totalDescuento}%`, alignment: 'center' },
                  { text: `19%`, alignment: 'center' },
                  { text: `${orden.totalDescuento}%`, alignment: 'center' }
                ],
                border: [false, true, false, true]
              },
              {
                stack: [
                  { text: `$${orden.totalNeto.toLocaleString()}`, alignment: 'right' },
                  { text: `$${orden.totalDescuento.toLocaleString()}`, alignment: 'right' },
                  { text: `$${orden.totalNetoFinal.toLocaleString()}`, alignment: 'right' },
                  { text: `$${orden.iva.toLocaleString()}`, alignment: 'right' },
                  { text: `$${orden.total.toLocaleString()}`, alignment: 'right' }
                ],
                border: [false, true, true, true]
              }
            ]
          ]
        }
      },

      { text: `\nLugar de Despacho: ${orden.lugarDespacho}`, style: 'small' },
      { text: `Recepciona: ${orden.recepciona}`, style: 'small' },
      { text: `Fecha Inicio Trabajos: ${orden.fechaInicio}`, style: 'small' },
      { text: `Condiciones de Pago: ${orden.condicionesPago}`, style: 'small' },

      { text: '\n' },
      {
        ul: [
          "Importante:",
          'Factura debe acompañar copia de la presente Orden de Compra.',
          'Orden de compra debe facturarse separadamente de cualquier otra (Se devolverá documento con más de una).',
          'Factura debe acompañar copia de Guía de Despacho recepcionada en obra.',
          'Factura debe ser entregada al momento del pago.'
        ],
        style: 'small'
      },

      { text: '\n\n\n\n\n' },
      {
        absolutePosition: { x: 70, y: 750 },
        columns: [
          { text: '________________________\nV°B Gerencia', alignment: 'center' },
          { text: '________________________\nAdministrador de Obra', alignment: 'center' },
          { text: '________________________\nGerente de Operaciones', alignment: 'center' }
        ]
      }
    ],
    styles: {
      header: { fontSize: 14, bold: true },
      headerSmall: { fontSize: 11, bold: true },
      small: { fontSize: 9 },
      subheader: { fontSize: 13, bold: true, margin: [0, 10, 0, 10] },
      total: { bold: true }
    }
  };

  pdfMake.createPdf(docDefinition).download(`orden-compra-${orden.numero}.pdf`);
}